function SearchVideo(){$.ajax("https://www.googleapis.com/youtube/v3/search?q="+$("#SearchQuery").val()+"&part=snippet&type=video&maxResults=25&key=AIzaSyDLd-4mlOr7Ql1v2KZftgNNdoj-dRc6Fog").done(n=>{$("#SearchResults").html(""),n.items.forEach(n=>{$("#SearchResults").append("<div onclick=\"ChooseVideo('"+n.id.videoId+'\')" class="video"><img src="'+n.snippet.thumbnails.high.url+'" /><h1>'+n.snippet.title+"<\/h1><\/div>")})})}function ChooseVideo(n){$("[name=YoutubeVideo]").val(n);$("#VideoSearch")[0].close();$.ajax("https://www.googleapis.com/youtube/v3/videos?id="+$("[name=YoutubeVideo]").val()+"&part=snippet&key=AIzaSyDLd-4mlOr7Ql1v2KZftgNNdoj-dRc6Fog").done(n=>{$("#video").css("background-image","url("+n.items[0].snippet.thumbnails.high.url+")")})}$("#video").click(()=>{$("#VideoSearch")[0].showModal()});let Timeout;$("#SearchQuery").keydown(()=>{Timeout&&clearTimeout(Timeout),Timeout=setTimeout(SearchVideo,500)});$("dialog")[0].addEventListener("click",function(n){n.target.tagName==="DIALOG"&&$("dialog")[0].close()});$("#picture").click(()=>{$("#fileUpload").trigger("click")});$("[data-link]").keyup(n=>{$($(n.target).attr("data-link")).text($(n.target).val())});$("#fileUpload").change(()=>{var t=$("#fileUpload")[0].files[0],n=new FileReader;n.addEventListener("load",function(){$("#picture").attr("src",n.result);$("[name=Image]").val(n.result)},!1);t&&n.readAsDataURL(t)});$("[name=Image]").val()!=""&&$("#picture").attr("src",$("[name=Image]").val());$("[name=YoutubeVideo]").val()!=""&&$.ajax("https://www.googleapis.com/youtube/v3/videos?id="+$("[name=YoutubeVideo]").val()+"&part=snippet&key=AIzaSyDLd-4mlOr7Ql1v2KZftgNNdoj-dRc6Fog").done(n=>{$("#video").css("background-image","url("+n.items[0].snippet.thumbnails.high.url+")")});